import './PageView.css';

const PageView = props => {
	const data = props.actualSportData;

	return (
		<section className="container">
	    	<div className="sport-title">
	    		<h1>{ data['attributes']['name'] }</h1>
	    		<div className="blackUnderline"></div>
	    	</div>
	    </section>
	);
}

export default PageView;
